let userReduser = (state = initialState, action) => {
    switch (action.type) {
        case FOLLOW_UNFOLLOW:
            return {
                ...state,
                users: state.users.map( u => {
                    if(u.id === action.userId){
                        return {...u, followed: u.followed === false}
                    }
                    return u
                })
            }
        case SET_USERS:{
            return {...state, users: [...state, ...action.users]}
        }
        default:
            return state;
    }
}

export const changeFollowStatusActionCreator = (userId) => ({type : FOLLOW_UNFOLLOW, userId: userId})
export const setUsersActionCreator = (users) => ({type : SET_USERS, users: users})


export default userReduser;

